import React from "react";
import Login from "./edocLogin";

// 유저 정보에 의해 폼이 바뀌는 것
// 이후 리덕스와 연결하여 state 중앙통제실을 만들어서 사용한다.
const dummy = {
  isLogined: false
};
const Main = () => {
  return <div>{dummy.isLogined ? null : <Login />}</div>;
};

export default Main;
